  false,\n\t\"url\": null,\n\t\"notes\": \"This report is an MS Excel spreadsheet
  broken up by state. Participating Jurisdictions can use this report to view open
  activities in IDIS including activities with 100 percent of the funds drawn and
  with a status code of FD, or final draw. The HOME final rule at 24 CFR 92.502(d)(1)
  requires Participating Jurisdictions to enter project completion data into IDIS
  within 120 days of making a final draw for a project (see HOMEfires Vol. 6 No. 1,
  August 2005). In addition, Participating Jurisdictions can view activities that
  have been open (OP) for several years with little or no HOME funds drawn. These
  projects, if not progressing, should be cancelled. Likewise, Field Offices can use
  this report as a desk-monitoring tool to view each Participating Jurisdictionu0092s
  open activities in need of completion or cancellation in IDIS.\",\n\t\"license_title\":
